import React, { Component } from 'react';
import axios from "axios";
import {Link} from "react-router-dom";


class Users extends Component {
    constructor(props){
        super(props);
        this.state={users:[]};
    }


    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/users').
        then(res => this.setState({users : res.data})).
        catch(err => console.log(err));
    }


    render() {
        var users= this.state.users.map((item,index)=>{
            return<li key={index}>
                    <Link to={`/contact/${item.id}/${item.name}`}>{item.name}</Link>
                </li>
        /*        <div className='usersDiv' key={index} style='display:block;'>
                    <div>
                         <input type='text'>ID:{item.id}</input>
                         <input type='text'>Name:{item.name}</input>
                         <input type='text'>Email:${item.email}</input>
                         <div><input type='button'>Other Data</input></div>
                         <div>
                             <input type='button'>Update</input>
                             <input type='button'>Delete</input>
                         </div>
                    </div>
                    <div>
                        <input type='text'>Street:{item.address.street}</input>
                        <input type='text'>City:{item.address.city}</input>
                        <input type='text'>Zipcode:{item.address.zipcode}</input>
                    </div>
                </div>*/
        });


        return (
            <div className="Users">
                PRINT USERS
                    {users}
                </div>
                );
    }
}

export default Users;
